# Rosalind 17, Minimum Skew Problem

def min_skew(sequence):
    skew_list = [0]
    counter = 0

    for letter in sequence:
        if letter == 'C':
            counter -= 1  # -1 for C
            skew_list.append(counter)
            
        elif letter == 'G':
            counter += 1  # +1 for G 
            skew_list.append(counter)
        
        else: 
            skew_list.append(counter)
            

    min_skew_val = min(skew_list) 
    
    min_skew_pos = [] # list for positions w/ the min skew
    
    
    for index, skew in enumerate(skew_list): # loop for skew list to find index & skew value
        if skew == min_skew_val:  
            min_skew_pos.append(index)  

    return min_skew_pos

sequence = ""


result = min_skew(sequence)
print(*result) 
